var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(b){const d=suggestions.querySelectorAll('a'),e=[...d],a=e.indexOf(document.activeElement),f=suggestions.classList.contains('d-none');let c=0;b.keyCode===38&&!f?(b.preventDefault(),c=a>0?a-1:0,d[c].focus()):b.keyCode===40&&!f&&(b.preventDefault(),c=a+1<e.length?a+1:a,d[c].focus())}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"https://doks.netlify.app/docs/provisioning/provision/",title:"Provisioning New Lab VM",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:'\u003ch2 id="get-started"\u003eGet started\u003c/h2\u003e\n\u003cp\u003eThere are two main ways to provision a new server:\u003c/p\u003e\n\u003ch3 id="net-boot-from-pxe"\u003eNet Boot from PXE\u003c/h3\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eThis is the recommended method. It will install Ubuntu 21.10 Impish Indri. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003eThis will guide you step-by-step through \u003ca href="/docs/provisioning/net-booting/"\u003eNet Booting. â†’\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="boot-from-iso-file"\u003eBoot from ISO file\u003c/h3\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eThis method will NOT configure your server with LDAP/AD authentication. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003eThis will guide you through provisioning via \u003ca href="/docs/provisioning/file-iso/"\u003eFile ISO. â†’\u003c/a\u003e\u003c/p\u003e\n'}).add({id:1,href:"https://doks.netlify.app/docs/provisioning/net-booting/",title:"Net Booting from PXE",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eFirst, ensure you have a VPN connection to the O\u0026rsquo;Fallon Lab, have valid Innovations Lab credentials, and can log into \u003ca href="https://adlbvc01.agiledefense.lab/ui/"\u003eInnovations Lab vSphere\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="provision"\u003eProvision\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eRight click on \u003cstrong\u003eDellCluster\u003c/strong\u003e and select \u003cstrong\u003eNew Virtual Machine\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_1.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="2"\u003e\n\u003cli\u003eSelect \u003cstrong\u003eCreate a new virtual machine\u003c/strong\u003e if it isn\u0026rsquo;t selected already and click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_2.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="3"\u003e\n\u003cli\u003eGive your VM a name, then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cblockquote\u003e\n\u003cp\u003e\u003csup\u003e\u003cstrong\u003eNOTE\u003c/strong\u003e: The name given will end up being the hostname of the vm, as well as the DNS routing name. (i.e. if you name it \u003ccode\u003eTest_VM\u003c/code\u003e, the hostname will be \u003ccode\u003eTestVM\u003c/code\u003e because underscores get removed and the DNS endpoint will be \u003ccode\u003etest_vm.agiledefense.lab\u003c/code\u003e)\u003c/sup\u003e\u003c/p\u003e\n\u003c/blockquote\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_3.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="4"\u003e\n\u003cli\u003eSelect a Resource Pool, if desired. Otherwise, select the parent \u003cstrong\u003eDellCluster\u003c/strong\u003e. We\u0026rsquo;re going to select \u003cstrong\u003eSoftwareDev\u003c/strong\u003e in this example. Click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_4.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="5"\u003e\n\u003cli\u003eSelect a storage solution for your vm and hit \u003cstrong\u003eNext\u003c/strong\u003e. I\u0026rsquo;m selecting \u003ccode\u003evsanDatastore\u003c/code\u003e because it has the largest capacity at the moment.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_5.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="6"\u003e\n\u003cli\u003eSelect \u003ccode\u003eESXI 6.7 Update 2 and later\u003c/code\u003e to ensure you have the latest compatibility hardware and performance features. Then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_6.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="7"\u003e\n\u003cli\u003eSelect \u003ccode\u003eLinux\u003c/code\u003e for \u003cstrong\u003eGuest OS Family\u003c/strong\u003e and \u003ccode\u003eUbuntu Linux (64-bit)\u003c/code\u003e for \u003cstrong\u003eGuest OS Version\u003c/strong\u003e and hit \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_7.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="8"\u003e\n\u003cli\u003eCustomize your virtual hardware settings.\n\u003col\u003e\n\u003cli\u003eSelect how many CPUs (\u003ccode\u003eRecommend a minimum of 2\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect how much Memory (\u003ccode\u003eRecommend a minimum of 2GB\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect Hard Disk size (\u003ccode\u003eRecommend a minimum of 50GB\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect \u003ccode\u003eBrowse\u003c/code\u003e in \u003cstrong\u003eNew Network\u003c/strong\u003e dropdown menu and choose the \u003ccode\u003eVM Lab\u003c/code\u003e network to ensure proper connectivity to the web.\u003c/li\u003e\n\u003cli\u003eCustomize the rest of the hardware to your desired specifications\u003c/li\u003e\n\u003c/ol\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_8.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="9"\u003e\n\u003cli\u003eSelect \u003cstrong\u003eVM Options\u003c/strong\u003e while still in the \u003cstrong\u003eCustomize hardware\u003c/strong\u003e menu and under \u003cstrong\u003eBoot Options\u003c/strong\u003e select \u003ccode\u003eEFI\u003c/code\u003e for \u003cstrong\u003eFirmware\u003c/strong\u003e, otherwise it will not boot properly.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_9.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="10"\u003e\n\u003cli\u003eNow scroll down and expend the \u003cstrong\u003eAdvanced\u003c/strong\u003e tab of the \u003cstrong\u003eVM Options\u003c/strong\u003e menu. The click \u003cstrong\u003eEDIT CONFIGURATION\u003c/strong\u003e under the \u003cstrong\u003eConfiguration Parameters\u003c/strong\u003e section. Then click \u003cstrong\u003eADD CONFIGURATION PARAMS\u003c/strong\u003e. Under \u003cstrong\u003eName\u003c/strong\u003e, type or copy/paste \u003ccode\u003eguestinfo.hostname\u003c/code\u003e. Under the \u003cstrong\u003eValue\u003c/strong\u003e type the name of your vm. In this case, it was \u003ccode\u003eTest_VM\u003c/code\u003e. Click \u003cstrong\u003eOK\u003c/strong\u003e and lastly, click \u003cstrong\u003eNext\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_10.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="11"\u003e\n\u003cli\u003eInspect your settings to ensure nothing was missed. When you\u0026rsquo;re ready, click \u003cstrong\u003eFinish\u003c/strong\u003e. Then, navigate to your VM in vSphere and click the green play (\u003ccode\u003estart\u003c/code\u003e) button to initiate cloud init.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_11.png" alt="img"\u003e\u003c/p\u003e\n\u003col start="12"\u003e\n\u003cli\u003eAfter 15-20 minutes, and several reboots, you should be able to ssh to your new vm utilizing your lab username and password.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_12.png" alt="img"\u003e\u003c/p\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!!\u003c/h3\u003e\n\u003cp\u003eYou\u0026rsquo;ve successfully net booted your first Linux VM in the Innovations Lab. For any issues that may arise during any of these steps, please see the \u003ca href="/docs/help/faq/"\u003eFAQ\u003c/a\u003e.\u003c/p\u003e\n'}).add({id:2,href:"https://doks.netlify.app/docs/provisioning/file-iso/",title:"Booting from File ISO",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:""}).add({id:3,href:"https://doks.netlify.app/docs/pipelines/",title:"Pipelines",description:"GoCd Pipelines",content:""}).add({id:4,href:"https://doks.netlify.app/docs/sonarqube/",title:"SonarQube",description:"SonarQube Security",content:""}).add({id:5,href:"https://doks.netlify.app/docs/help/how-to-update/",title:"How to Update",description:"Regularly update the installed npm packages to keep your Doks website stable, usable, and secure.",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ’¡ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eLearn more about \u003ca href="https://docs.npmjs.com/about-semantic-versioning"\u003esemantic versioning\u003c/a\u003e and \u003ca href="https://docs.npmjs.com/cli/v6/using-npm/semver#advanced-range-syntax"\u003eadvanced range syntax\u003c/a\u003e. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003ch2 id="check-for-outdated-packages"\u003eCheck for outdated packages\u003c/h2\u003e\n\u003cp\u003eThe \u003ca href="https://docs.npmjs.com/cli/v7/commands/npm-outdated"\u003e\u003ccode\u003enpm outdated\u003c/code\u003e\u003c/a\u003e command will check the registry to see if any (or, specific) installed packages are currently outdated:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm outdated [[\u0026lt;@scope\u0026gt;/]\u0026lt;pkg\u0026gt; ...]\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch2 id="update-packages"\u003eUpdate packages\u003c/h2\u003e\n\u003cp\u003eThe \u003ca href="https://docs.npmjs.com/cli/v7/commands/npm-update"\u003e\u003ccode\u003enpm update\u003c/code\u003e\u003c/a\u003e command will update all the packages listed to the latest version (specified by the tag config), respecting semver:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm update [\u0026lt;pkg\u0026gt;...]\n\u003c/code\u003e\u003c/pre\u003e\n'}).add({id:6,href:"https://doks.netlify.app/docs/help/troubleshooting/",title:"Troubleshooting",description:"Solutions to common problems.",content:'\u003ch2 id="problems-updating-npm-packages"\u003eProblems updating npm packages\u003c/h2\u003e\n\u003cp\u003eDelete the \u003ccode\u003e./node_modules\u003c/code\u003e folder, and run again:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm install\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch2 id="problems-with-cache"\u003eProblems with cache\u003c/h2\u003e\n\u003cp\u003eDelete the temporary directories:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm run clean\n\u003c/code\u003e\u003c/pre\u003e\n'}).add({id:7,href:"https://doks.netlify.app/docs/help/faq/",title:"FAQ",description:"Answers to frequently asked questions.",content:'\u003ch2 id="hyas"\u003eHyas?\u003c/h2\u003e\n\u003cp\u003eDoks is a \u003ca href="https://gethyas.com/themes/"\u003eHyas theme\u003c/a\u003e build by the creator of Hyas.\u003c/p\u003e\n\u003ch2 id="footer-notice"\u003eFooter notice?\u003c/h2\u003e\n\u003cp\u003ePlease keep it in place.\u003c/p\u003e\n\u003ch2 id="keyboard-shortcuts-for-search"\u003eKeyboard shortcuts for search?\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003efocus: \u003ccode\u003eCtrl + /\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eselect: \u003ccode\u003eâ†“\u003c/code\u003e and \u003ccode\u003eâ†‘\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eopen: \u003ccode\u003eEnter\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eclose: \u003ccode\u003eEsc\u003c/code\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="other-documentation"\u003eOther documentation?\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://docs.netlify.com/"\u003eNetlify\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://gohugo.io/documentation/"\u003eHugo\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="can-i-get-support"\u003eCan I get support?\u003c/h2\u003e\n\u003cp\u003eCreate a topic:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://community.netlify.com/"\u003eNetlify Community\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://discourse.gohugo.io/"\u003eHugo Forums\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://github.com/h-enk/doks/discussions"\u003eDoks Discussions\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="contact-the-creator"\u003eContact the creator?\u003c/h2\u003e\n\u003cp\u003eSend \u003ccode\u003eh-enk\u003c/code\u003e a message:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://community.netlify.com/"\u003eNetlify Community\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://discourse.gohugo.io/"\u003eHugo Forums\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://github.com/h-enk/doks/discussions"\u003eDoks Discussions\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n'}).add({id:8,href:"https://doks.netlify.app/docs/help/",title:"Help",description:"Help Doks.",content:""}).add({id:9,href:"https://doks.netlify.app/docs/",title:"Docs",description:"Agile Defense Docs",content:'\u003ch2 id="servers"\u003eServers\u003c/h2\u003e\n\u003cp\u003eTo make vm\u0026rsquo;s in the lab, see \u003ca href="/docs/provisioning/provision/"\u003eProvisioning â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="pipelines"\u003ePipelines\u003c/h2\u003e\n\u003cp\u003eTo automate with pipelines, go to \u003ca href="/docs/pipelines/"\u003ePipelines â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="sonarqube"\u003eSonarQube\u003c/h2\u003e\n\u003cp\u003eTo secure your code with SonarQube, go visit \u003ca href="/docs/sonarqube/"\u003eSonarQube â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch1 id="list-of-docs-pages"\u003eList of Docs Pages\u003c/h1\u003e\n'}),search.addEventListener('input',b,!0),suggestions.addEventListener('click',c,!0);function b(){var d,e;const c=5;d=this.value,e=a.search(d,{limit:c,enrich:!0}),suggestions.classList.remove('d-none'),suggestions.innerHTML="";const b={};e.forEach(a=>{a.result.forEach(a=>{b[a.doc.href]=a.doc})});for(const d in b){const e=b[d],a=document.createElement('div');if(a.innerHTML='<a href><span></span><span></span></a>',a.querySelector('a').href=d,a.querySelector('span:first-child').textContent=e.title,a.querySelector('span:nth-child(2)').textContent=e.description,suggestions.appendChild(a),suggestions.childElementCount==c)break}}function c(){while(suggestions.lastChild)suggestions.removeChild(suggestions.lastChild);return!1}})()